import React, { Component, useImperativeHandle } from "react";
import axios from 'axios';

class Inventory extends Component{
    constructor() {
        super();
        this.state = {
            inventoryItems: [],userID:''
        }
    }

    Get()
    {
        const url = "https://localhost:7001/items";
        /*useEffect(() => {
            fetch(url).then(response => response.json()).then(data => console.log(data));
        }, []);*/

        axios.get(url,{params:{userId:userID}}).then(Res => {
            console.log(Res.data)
            this.setState({
                inventoryItems: Res.data
        })
        });
    }
    render()
    {

        const {inventoryItems}=this.state
        return (<>            
            <div>
                 <text values={userID}></text>
                 <button onClik={Get}></button>
                <h1>Inventory Items</h1>

                <table className="">
                    <tr>
                        <td>ID</td>
                        <td>Name</td>
                        <td>Description</td>
                        <td>Quantity</td>
                        <td>Created Date</td>
                    </tr>             
                {
                    inventoryItems.length ?
                            inventoryItems.map(item => 
                                <tr key={item.catalogItemId}>
                                    <td>{item.catalogItemId}</td>
                                    <td>{item.name}</td>
                                    <td>{item.description}</td>
                                    <td>{item.quantity}</td>
                                    <td>{item.acquiredDate}</td>
                                </tr>
                        ) : null                       
                }
            </table>
            </div>
        </>
        );
    }
}

export default Inventory
